import React from 'react'
import './index.css';

function Common(props) {
  return (
    <div className='common'>
      <div>
          <img src={props.img} ></img>
      </div>

      <style jsx>
        {
          ` .txtc{
              margin: 0px 20px 0px 20px;
            }
          `
        }
      </style>

      <div className='textc'>
          {props.name}
      </div>

    </div>
  )
}

export default Common
